import { DefaultButton } from "../Buttons/defaultButton"
import { bgColor1f, bgColor4e, bgColor5e } from "../Styles/backGroundColor"

export function SettingsModal({open, onClose}){
    // check if open
    if (!open) return

    return (
    <div style={{width:"100%", height:"100px", backgroundColor:bgColor1f}}>
        <DefaultButton name="close" fontSize="20px" color="red" click={onClose}/>
    </div>)
}
